import React from 'react';
import logo from './logo.svg';
import './App.css';
import RecepieCard from './RecepieCard'
import NavBar from './NavBar'

function App() {
  return (
    <div className="App">
		  <NavBar/>
		  <RecepieCard
			  title = "pasta"
			  ingredients = {['flour', 'oil']}
			  instructions = "Mix all the stuff"
			  img = 'logo192.png'
			/>
    </div>
  );
}

export default App;
